import React from "react";
import System from "../System/System";
import Wrapper from "../helper/Wrapper";
import { Helmet } from "react-helmet";
const FeaturePage = () => {
  return (
    <>
    <Helmet>
      <title>Tính năng </title>
    </Helmet>
    <Wrapper>
      <System />
    </Wrapper>
    </>
  );
};

export default FeaturePage;
